    "Chemical, biological and toxicological investigation of oil drilling impacts to
    aquatic resources in the Yellowbank Slough region near New Haven, Illinois",nt"tracking_summary":
    {ntt"total": 15,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-04-24T15:03:01.020312",nt"name": "chemical-biological-and-toxicological-investigation-of-oil-drilling-impacts-to-aquatic-res",nt"isopen":
    false,nt"url": null,nt"notes": "A survey of contaminants in sediments and
    aquatic macroinvertebrates at several locations on the proposed Yellowbank Slough
    National Wildlife Refuge was conducted during the 1990 and 1991 field seasons. Surface
    water samples, bottom sediments and aquatic macroinvertebrates were collected at
    selected sampling locations for chemical analysis and aquatic invertebrate bioassays.
    This paper reports the concentrations of inorganic and organic chemical parameters
    in bed sediments, the results of Ceriodaphnia dubia and Hyalella azteca bioassays,
    and the results of the MicrotoxTM assays for sediment and water samples collected
    from selected locations in the drainage. Although widespread contamination due to
    oil and gas development activities was not apparent from the data obtained during
    the present study, the results indicate that there may be some potential localized
    areas of concern throughout the proposed area of acquisition in the Yellowbank Slough
    region.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
